import React from "react";
import classes from './Burger.module.css';

const Burger = (props) => {
  return (
    <>
      <div onClick={props.onClick}className={classes.burger}>
        <div className={`${classes.icon} ${classes.icon1}`}></div>
        <div className={`${classes.icon} ${classes.icon2}`}></div>
        <div className={`${classes.icon} ${classes.icon3}`}></div>
      </div>
    </>
  );
};

export default Burger;
